import { Cookies } from 'react-cookie';
import fetch from 'isomorphic-unfetch';


export default class extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            items: []
        };
    }

    componentDidMount() {
        fetch(`http://167.172.142.165/users`, {
            method: 'GET',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
                'Authorization': 'Token 19c3e6789349d414ac66ae3c17a80c4e8a12debc'
            },
        })
            .then(res => res.json())
            .then(
                (result) => {
                    console.log(result)
                    this.setState({
                        items: result.items
                    });
                },
                (error) => {
                    console.log(error)
                }
            )


    }

    render() {
        return (
            <>
                <ul>
                    {props.shows.map(show => (
                        <a>{show.username}</a>
                    ))}
                </ul>
            </>
        );
    }
}
